type TPanelTable = {
  label: string;
  value: number;
  valueType?: "State" | "Number";
  onClickDetail: (n: any) => void;
  onClickState: (n: string) => void;
  isClicking: string;
  style?: any;
};
const PanelTable = ({
  label,
  value,
  valueType = "State",
  onClickDetail,
  onClickState,
  isClicking,
  style,
}: TPanelTable) => {
  const [isHovering, setIsHovering] = useState(0);

  return (
    <table
      onClick={() => {
        onClickDetail("");
        onClickState(label);
      }}
      onMouseOver={() => setIsHovering(1)}
      onMouseOut={() => setIsHovering(0)}
      style={{
        width: style != undefined ? style.width : "90px",
        height: "35px",
        backgroundColor:
          isHovering == 1 || isClicking == label ? "#3e80ed5e" : "",
        cursor: "Pointer",
      }}
    >
      <tbody>
        <tr>
          <th>{label}</th>
          <td>
            <span
              className={valueType === "Number" ? "number" : "sts sts" + value}
            >
              <span className="light"></span>

              {valueType === "Number"
                ? value
                : Number(value) === 1
                ? "정상"
                : Number(value) === 2
                ? "통신 에러"
                : Number(value) === 3
                ? "작은 고장"
                : Number(value) === 4
                ? "큰 고장"
                : ""}
            </span>
          </td>
        </tr>
      </tbody>
    </table>
  );
};
