type TVisionDetailPanel = {
  position: any;
  isSelected: boolean;
  data: any[];
  onClickDetail: (n: any) => void;
  onClickState: (n: any) => void;
};
const VisionDetailPanel = ({
  position,
  isSelected,
  data,
  onClickDetail,
  onClickState,
}: TVisionDetailPanel) => {
  const tpData = data.filter((row: any) => row.Tp_No !== "");

  const categories = tpData.map((row: any) => row.Tp_InsertTime);
  const tpJig = tpData.map((row: any) => row.Tp_JIG);

  return isSelected ? (
    <group position={position} rotation={[0, 0, 0]}>
      <Marker rotation={[0, 0, 0]}>
        <DataContainer
          onClick={() => {
            onClickDetail(null);
            onClickState("");
          }}
          style={{
            width: "320px",
            height: "300px",
            padding: "20px",
          }}
        >
          <p
            style={{
              textAlign: "center",
              marginBottom: "20px",
            }}
          >
            비젼 불량 추이
            <br />
            {data.length > 0 && (
              <>
                ({convertDateToStrWithTime2(new Date())})
              </>
            )}
          </p>
          <div style={{ width: "100%", height: "auto", display: "flex" }}>
            <Chart style={{ height: "200px" }}>
              {/* <ChartTitle text="Vision 불량 추이" /> */}
              <ChartLegend position="bottom" orientation="horizontal" />

              <ChartCategoryAxis>
                <ChartCategoryAxisItem
                  categories={categories}
                  visible={false}
                />
              </ChartCategoryAxis>
              <ChartSeries>
                <ChartSeriesItem
                  type="line"
                  tooltip={{ visible: true }}
                  data={tpJig}
                  name={"불량"}
                  markers={{
                    size: 4,
                  }}
                />
              </ChartSeries>
            </Chart>
          </div>
        </DataContainer>
      </Marker>
    </group>
  ) : (
    <></>
  );
};

